description:
Cult hostess Eden presents a varied selection of the most weird, bizarre and downright outlandish clips from the worlds of film, video, television and the Internet.

Four episodes of the late night Channel 5 cult clips show OutTHERE. Two episodes from series 2 with Anneka Svenska and 2 from series 3 with Emily Booth. There are, as far as I can see, no episodes of this on the internet and it's not available on dvd etc. These are the only episodes I have so if anyone else has any please upload them if you can so the programme doesn't just disappear.

This is DVD vob format, 720x576i 25fps taken from VHS recordings made with a stereo video recorder.

Enjoy the craziness.
